function Getlist(props){

 const {listdata} =props
 const {page} =props
let dat;

if(typeof listdata != "undefined"){
    dat = listdata.map((item, index)=>{
        return <li key={item.id}> {item.title}</li>
 })}

return(
    
    <div>
        <h1>pagina: {Page}</h1>
        <button onClick={props.nexthandle}>next</button>
        <button onClick={props.prevhandle}>prev</button>

        <h2>items</h2>
        <ul>
         {dat}
        </ul>
    </div>
)
}

export default Getlist
